import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';


function GamerDetails({ gproduct }) {
    console.log(gproduct)
    return (
        <Card className="my-3 p-3 rounded">
            <Link to={`/gamer/${gproduct.id}`}></Link>
            <Card.Img variant="top" src={gproduct.image} />
            <Card.Body>
                <Card.Title>{gproduct.name}</Card.Title>
                <Card.Text>
                    {gproduct.description}
                </Card.Text>
                <Button variant="primary">Buy Now</Button>
            </Card.Body>
        </Card>

    )
}

export default GamerDetails;
